 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';
import { Button } from "@mui/material";

 const Mainproduct = () => {


const listItem=product_cart.map((item)=>


  <Box className="b"
      style={{
        marginTop: '20px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: 'blue',
      }}
    >
      <Box className="bb"
        style={{
          //color: 'black',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          maxWidth: '158px',
          overflow: 'auto',
        backgroundColor: 'red',

        }}
      >

<Box className="cart" key={item.id} sx={{backgroundColor:"yellow"}}>
<Box  >
<img src={item.thumb} alt="Logo" style={{ height: '100px', margin: '10px', flexGrow: 1 }} />
</Box>

<Box classname="card_header" >
<h2>{item.name}</h2>
<p>{item.description}</p>
<p className="price"><span>{item.real_price}</span></p>
<div className="consult item" sx={{backgroundColor:"orange"}}></div>

</Box>

    </Box>
    </Box>
    </Box>
 );




return (
  
      <Box className="main_content" sx={{display:"flex",
    justifycontent: "center",
    alignItems:"center"}}  >
          {listItem}
      </Box>
     
      
  
);
}

 export default  Mainproduct;
